ファブリーズ フローラルブーケの香り 詰替用 320ml<br>ブランド：ファブリーズ<br>販売・製造元：P&G(プロクター・アンド・ギャンブル)<br><br>布製品のイヤなニオイを取り除くだけでなく、除菌もできる消臭剤です。<br>トウモロコシ由来の消臭成分と野菜や果物に含まれる酸と同じ成分を配合した除菌成分を使用。<br>お肌に触れる衣類、お子様のいるご家庭でもお使いいただけます。<br>小鳥のさえずるお花畑でくつろいでいる香りをイメージしました。<br>詰め替え用。<br> <br><br>ボトルへのつめかえ方1.開ける*手は袋の上の方にそえて下さい。<br>(胴体部分を持つと液が飛び出すことがあります)*切り口にご注意<br>下さい。<br>2.そそぐ*つめかえの口が閉じない、ぶれない。<br>さし込みチューブをボトルのそそぎ口にさし込んで、ゆっくり注いで下さい。<br>3.しぼるときまで汚れず手間なし。<br>●ファブリーズ くつろぐフローラルシャワーの香りのボトルに詰め替えてお使い下さい。<br>洗剤など他の製品などと混ぜないで下さい。<br>●これは飲み物ではありません。<br> 使用回数約330回スプレーできます。<br>(ボトルつめかえ時) 用途衣類・布製品用消臭剤 <br><br>使用上の注意<br>・皮、和装品へは使用不可。<br>毛、絹・レーヨン・アセテート・キュプラなど水に弱い繊維、水洗い不可の表示があるもの、防水・撥水加工など特殊加工されたものは、しみになったり、風合いを損ねる恐れがあるので、あらかじめ目立たない部分で試す。<br>・20cmより近づけたり、一度にスプレーしたすぎたりしない。<br>しみやベタつきの原因になることがある。<br>・汚れのあるものは、汚れが原因の輪ジミを起こすことがある。<br>・汚れが原因のニオイは、使用後、汚れから再びニオイが発生することがある。<br>・スプレーは手早く最後まで引ききる。<br>・床や家具など布製品以外についた場合はすぐに拭き取る。<br>・直射日光の当たる場所や温度差の激しい場所(電化製品の上など)での保管は避ける。<br>・狭い空間で使用するときは、換気して使用する。<br>・用途以外に使用しない。<br>・子供の手の届く所に置かない。<br>・顔に向けてスプレーしない。<br>・目に入った場合は、水で十分洗い流す。<br> <br>成分<br>トウモロコシ由来消臭成分、除菌成分(有機系)、香料 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／消臭剤 衣類用<br>JANコード： 4902430221511<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
